import React from "react";
import classes from './About_Basic.module.css';
import UnitBar from './UnitBar';
import UnitBarFirstName from './UnitBarFirstName';
import UnitBarLastName from './UnitBarLastName';
import UnitBarRole from './UnitBarRole';

import UnitBarGenDOB from './UnitBarGenDOB';
import UnitBarPosiEmail from './UnitBarPosiEmail';


import UnitAboutIcon from './UnitAboutIcon';
import UnitEducationIcon from './UnitEducationIcon';
import UnitContactIcon from './UnitContactIcon';
import UnitBarInstDegree from './UnitBarInstDegree';
import axisInstance from '../../../../axios';

const About_Basic=()=>{




const [data, setData ] = useState({});



useEffect(() =>{

      axiosInstance.get().then((res) => {
                        setData(res.data);
                        console.log('currentUser',res.data);
                });



  },[]);












return (


<div className={classes.about_Basic}>	
<UnitBar/>

<UnitAboutIcon/>




   <div className={classes.aboutInfoContainer}>	
      <UnitBarFirstName/>

      <UnitBarLastName/>

      <UnitBarRole/>

      <UnitBarGenDOB/>	

      <UnitBarPosiEmail/>	
   </div>


<UnitBar/>


<UnitEducationIcon/>	

   <div className={classes.aboutInfoContainer}>
      <UnitBarInstDegree degree={"MSc"} univ={"Indian Institute of Technology, Delhi"}/>

      <UnitBarInstDegree degree={"MTech"} univ={"N/A"}/>


      <UnitBarInstDegree degree={"BSc"} univ={"O.U.A.T Bhubaneswar"}/>

      <UnitBarInstDegree degree={"BTech"} univ={"N/A"}/>


      <UnitBarInstDegree degree={"K-12"} univ={"College of Basic Science and Humanities, Bhubaneswar"}/>


      <UnitBarInstDegree degree={"K-10"} univ={"Sanjudevi High School, Kiapada, Jajpur"}/> 

   </div>

<UnitBar/>

<UnitContactIcon/>

  <div className={classes.aboutInfoContainer}>
      <UnitBarInstDegree degree={"MSc"} univ={"Indian Institute of Technology, Delhi"}/>


  </div>
</div>	

);


}


export default About_Basic;
